import React from 'react';
import './Map.scss';

function Map(props) {
    const mapUrl = `https://www.google.com/maps/embed/v1/search?q=${props.map}&key=${process.env.REACT_APP_GOOGLE_KEY}`

    return (
        <div className='map'>
            <iframe
                title={props.address}
                width="600" 
                height="250"
                frameBorder="0"
                src= {mapUrl}
                allowFullScreen>
            </iframe>
        </div>
    );
}

export default Map;
